import { Component } from "react";
import "./App.css";
import Login_form from "./login_form";
import Create_address from "./create_address";
import Find_id from "./find_id";
import Find_pass from "./find_pass";
import { BrowserRouter, Route, Routes } from "react-router-dom";
import { Main, Info_modify, Schedule, Products, Whoops404 } from "./Pages";

class App extends Component {
  state = {
    using_id: "",
  };
  render() {
    return (
      <div className="App">
        <BrowserRouter>
          <Routes>
            <Route path="/" element={<Login_form></Login_form>}></Route>

            <Route
              path="/create"
              element={<Create_address></Create_address>}
            ></Route>
            <Route path="/find_id" element={<Find_id></Find_id>}></Route>
            <Route path="/find_pass" element={<Find_pass></Find_pass>}></Route>
          </Routes>
          <Routes>
            <Route path="/main" element={<Main></Main>}></Route>
            <Route path="/main/Info_modify" element={<Info_modify />} />
            <Route path="/main/Schedule" element={<Schedule />} />
            <Route path="/main/Products" element={<Products />} />
          </Routes>
        </BrowserRouter>
      </div>
    );
  }
}

export default App;
